.inspection_edit_wrapper {

.inspection_edit_wrapper-unit {

}
.inspection_edit_wrapper--content-field {

  justify-content: center;
}
.inspection_edit_wrapper--content_col {
  display: flex;
  flex-flow: row wrap;
}
.inspection_edit_wrapper--content_col-title {

  font-size: 20px;

}
.inspection_edit_wrapper--content_col-subtitle {
  display: flex;
  width: 100%;
  color: #131A21;

}
.inspection_edit_wrapper--content_col .rs-form-group {
  width: 100%;
}
.inspection_edit_wrapper--content_col .rs-form-group .rs-control-label {
  color: #131A21;
  font-size: 16px;
}
.inspection_edit_wrapper--content_col .rs-form-group .rs-form-control-wrapper {
  color: #131A21;
  width: 100%;
  border: 1px solid #001d4d;

.inspection_edit_wrapper--content_input {
  width: 100% !important;
  height: 40px;
  border: none;
}
.inspection_edit_wrapper--content_input .rs-picker-toggle.rs-btn {
  padding-top: 9px;
  padding-bottom: 9px;
  border: none;
}
.inspection_edit_wrapper--content_input.over-threshold {
  color: #f00;
}
.inspection_edit_wrapper--content_input.over-threshold .rs-input {
  color: #f00;
}
.inspection_edit_wrapper--content_error {
  flex: 100% 1;
  font-size: 12px;
  margin-top: 5px;
  color: #ff0000;
}
.inspection_edit_wrapper--chart {
  width: 440px;
  margin: 0 15px;
}
.inspection_edit_wrapper--chart_score {

  padding: 30px 40px;
  background-color: #D1DDE8;
  justify-content: center;
  align-items: center;
  color: #002A66;
  box-shadow: 0px 2px 8px rgba(0, 0, 0, 0.06);

}
.inspection_edit_wrapper--chart_score__text {
  font-size: 24px;
}
.inspection_edit_wrapper--chart_score__number {
  margin: 0 20px;
  font-size: 48px;
}
.inspection_edit_wrapper--chart_content {
  display: flex;
  padding: 20px;
  background-color: #fff;
  margin-top: 20px;
}
.inspection_edit_wrapper--chart_content .echarts-for-react {
  width: 100%;
}
.custom-tooltip {
  background-color: #fff;
  padding: 20px;
  border-radius: 4px;
  box-shadow: #bbbbbb 0 0 10px;
}
@media screen and (max-width: 990px) {

  }

.interview-edit {
  background-color: #F0F3F5;
  overflow-y: auto;
}
.interview-create_content,
.interview-edit_content {
  display: flex;
  width: 100%;
  padding: 20px;
}
.interview-create_content--tab,
.interview-edit_content--tab {
  width: 100%;
  background-color: #fff;
  padding: 10px 20px;
  border-radius: 4px;
}
.interview-create_content--tab_header,
.interview-edit_content--tab_header {
  display: flex;
  border-bottom: 1px solid #F0F3F5;
}
.interview-create_content--tab_header__item,
.interview-edit_content--tab_header__item {
  padding: 10px 0;
  margin-right: 40px;
  font-size: 20px;
  font-weight: 500;
  color: #828282;
  cursor: pointer;
}
.interview-create_content--tab_header__item.active,
.interview-edit_content--tab_header__item.active {
  color: #002A66;
  border-bottom: 2px solid #002A66;
}
.interview-create_content--tab_content,
.interview-edit_content--tab_content {
  display: none;
  width: 100%;
  padding: 10px 0;
}
.interview-create_content--tab_content.active,
.interview-edit_content--tab_content.active {
  display: block;
}
.interview-create_content--score,
.interview-edit_content--score {
  width: 400px;
  margin-left: 30px;
}
.interview-create_content--score_box.bgr_danger,
.interview-edit_content--score_box.bgr_danger {
  color: #EB5757;
}
.interview-create_content--score_box,
.interview-edit_content--score_box {
  display: flex;
  padding: 30px 40px;
  background-color: #D1DDE8;
  justify-content: center;
  align-items: center;
  color: #002A66;
  box-shadow: 0px 2px 8px rgba(0, 0, 0, 0.06);
  border-radius: 4px;
}
.interview-create_content--score_box__text,
.interview-edit_content--score_box__text {
  font-size: 24px;
  margin-right: 10px;
}
.interview-create_content--score_box__score,
.interview-edit_content--score_box__score {
  margin-left: 10px;
  font-size: 48px;
}
.interview-create_content--score_text,
.interview-edit_content--score_text {
  margin: 10px 0;
  color: #000000;
  font-size: 16px;
}
.interview-create_content--score_text p,
.interview-edit_content--score_text p {
  margin-bottom: 10px;
}
.interview-create__general-checkbox,
.interview-edit__general-checkbox {
  display: flex;
  color: #131A21;
}
.interview-create__general-checkbox .rs-form-group:nth-child(2),
.interview-edit__general-checkbox .rs-form-group:nth-child(2) {
  display: flex;
  flex: 1 1;
  width: 100%;
}
.interview-create__general-checkbox .rs-form-group:nth-child(2) .rs-control-label,
.interview-edit__general-checkbox .rs-form-group:nth-child(2) .rs-control-label {
  color: #131A21;
}
.interview-create__general-checkbox .rs-form-group:nth-child(2) .rs-form-control-wrapper,
.interview-edit__general-checkbox .rs-form-group:nth-child(2) .rs-form-control-wrapper {
  width: 100%;
  color: #131A21;
}
.interview-create__general-col,
.interview-edit__general-col {
  display: flex;
  justify-content: center;
  margin-bottom: 10px;
}
.interview-create__general-col .rs-form-group,
.interview-edit__general-col .rs-form-group {
  display: flex;
  width: 100%;
}
.interview-create__general-col .rs-form-group .rs-control-label,
.interview-edit__general-col .rs-form-group .rs-control-label {
  color: #131A21;
  width: 60px;
}
.interview-create__general-col .rs-form-group .rs-form-control-wrapper,
.interview-edit__general-col .rs-form-group .rs-form-control-wrapper {
  color: #131A21;
  width: 100%;
}
.interview-create__general-col > span,
.interview-edit__general-col > span {
  line-height: 40px;
}
.interview-create__general-input,
.interview-edit__general-input {
  width: 100% !important;
  height: 40px;
  border-color: #001d4d;
}
.interview-create__general-input .rs-picker-toggle.rs-btn,
.interview-edit__general-input .rs-picker-toggle.rs-btn {
  padding-top: 9px;
  padding-bottom: 9px;
  border-color: #001d4d;
}
.interview-create__general-error,
.interview-edit__general-error {
  flex: 100% 1;
  margin-top: 5px;
  color: #ff0000;
}
.interview-create .rs-radio-checker,
.interview-edit .rs-radio-checker {
  padding-top: 9px;
  padding-bottom: 9px;
}
@media screen and (max-width: 990px) {
  .interview-create_content,
  .interview-edit_content {
    flex-flow: column wrap;
  }
  .interview-create_content--score,
  .interview-edit_content--score {
    width: 100%;
    margin: 0;
    margin-top: 20px;
  }
}
